/* COMPONENTS IMPORT */
import BookList from "./components/BookList";
/* APOLO CLIENT IMPORTS */
import {
  ApolloClient,
  InMemoryCache,
  ApolloProvider
} from "@apollo/client";
/* CLIENT ITSELF */
const client = new ApolloClient({
  uri: 'http://localhost:4000/graphql',
  cache: new InMemoryCache()
});


function App() {
  return (
    /* PRINCIPAL DIV */
    <div id="main">
     <h1>Ninja is op</h1>
     {/* BOOK LIST COMPONENT */}
     <ApolloProvider client={client}>
       <BookList></BookList>
     </ApolloProvider>

    </div>
  );
}

export default App;
